import React from 'react';

interface CardProps {
  title: string;
}

const Card: React.FC<CardProps> = ({ title }) => {
  const imageUrl = process.env.PUBLIC_URL + `/PlayingCards/${title}`;

  return (
    <div className="card">
      <img src={imageUrl} alt={title} className="card-image w-275px h-387px" />
    </div>
  );
};

export default Card;
